import math

def find_primes(start, end):
    primes = []
    for num in range(start, end - 1):
        if num < 2:
            continue
        if num == 2:
            primes.append(num)
            continue
        if num % 2 == 0:
            continue
        for i in range(3, int(math.sqrt(num)) + 1, 2):
            if num % i == 0:
                break
        else:
            primes.append(num)
    return primes

